
const express = require('express')
const app = express()
const cors = require('cors')
const bp = require('body-parser')
const port = 3000

app.use(cors())
app.use(bp.json())
app.use(bp.urlencoded({ extended: true }))

const applications = [{ 
    name: 'The one quote', 
    img: 'data:image/png;base64,', 
    description: 'Get the quotes of every characters in every films.',
    url: 'http://localhost:4201/'
  },
  { 
    name: 'Middle Hearth Demography', 
    img: 'data:image/png;base64,', 
    description: 'Get a graph of the demography type in each Middle Earth city.',
    url: 'http://localhost:4200/'
  }];

const userToken = 'c2F1cm9u';

const user = {
  name: 'Sauron',
  applications,
  email: 'sauron@mordor.net'
}

app.get('/', (req, res) => {
  res.send('Hello Middle Hearth!')
})

app.get('/applications', (req, res) => {
  res.send({applications})
})

app.post('/login', (req, res) => {
  const login = req.body.login;
  const password = req.body.password;

  if(login === 'sauron' && password === 'admin')
    res.status(200).send({token: userToken})
  else
    res.status(401).send(new Error('Wrong login or password'));
})

app.get('/user', (req, res) => {
  if(req.query.token === userToken) 
    res.status(200).send({user})
  else
    res.status(401).send(new Error('Not connected'));
})

app.listen(port, () => {
  console.log(`Example app listening on port ${port}`)
})